const bcrypt = require('bcrypt');
const i18n = require('i18n');

const populate = async (req, res) => {
    try {
        const User = req.User;
        const Role = req.Role;
        const roleName = 'ADMIN';
        const permissions = {
            user: 'CRUD',
            role: 'CRUD',
            question: 'CRUD',
            test: 'CRUD',
            job: 'CRUD',
            application: 'CRUD',
        };

        const roleExists = await Role.exists({
            roleName: roleName.toUpperCase(),
            active: true,
        });

        if (roleExists) return res.status(409).send('Le rôle existe déjà.');

        const role = await Role.create({
            roleName: roleName.toUpperCase(),
            permissions: permissions,
        });
        if (!role)
            return res
                .status(500)
                .send(i18n.__('An unknown problem has occurred, please try again later'));

        const hash = await bcrypt.hash(
            process.env.ADMIN_INITIAL_PASSWORD,
            Number(process.env.BCRYPT_SALT)
        );
        const userInformation = {
            email: process.env.ADMIN_INITIAL_EMAIL,
            role: role._id,
            active: true,
            password: hash,
            firstName: 'SUPER',
            lastName: 'ADMIN',
            phone: '',
            job: 'ADMIN',
        };
        const userExists = await User.exists({
            email: userInformation.email.toLowerCase(),
        });

        if (userExists)
            return res.status(409).send("L'utilisateur existe déjà.");

        const roleExist = await Role.exists({ _id: userInformation.role });
        if (!roleExist) return res.status(400).send("Le rôle n'existe pas ");

        const phoneExist = await User.exists({ phone: userInformation.phone });
        if (phoneExist) return res.status(409).send('Le phone existe ');

        userInformation.email = userInformation.email.toLowerCase();

        //generate a random avatar for the user
        if (!userInformation.avatar)
            userInformation.avatar = `64_${
                Math.floor(Math.random() * 15) + 1
            }.png`;

        const userCreated = await User.create({
            ...userInformation,
        });

        if (!userCreated)
            return res
                .status(500)
                .send(i18n.__('An unknown error has occurred, please try again later.'));

        res.status(201).send('Created');
    } catch (e) {
        return res.status(500).send('Error: ' + e.message);
    }
};
